import { Button } from "react-bootstrap";
import useLocalStorage from "../../utils/useLocalStorage";

export default function Settings() {
  function logout(event) {
    event.preventDefault();
  }

  return (
    <div>
      <Button onClick={logout}>Logout</Button>
    </div>
  );
}
